import React from "react";
import Search from "./Search";

function Location({locations, search, setSearch}) {

    const location = locations.map(location => {
        return <LocationCard 
          key={location.id} 
          location={location} 
          />
      })

    return (
        <div>
            <Search onSearch={setSearch}/>
        </div>
    )
}


export default Location;
